II Obrigações do IFTM, representado por seus campi e campi avançados, na pessoa deseus
respectivos coordenadores de estágio:
a. Celebrar Termo de Compromisso de Estágio com o estudante ou com seu representante ou
assistente legal, quando ele for absoluto ou relativamente incapaz, e com a Unidade Concedente,
indicando as condições de adequação do estágio à proposta pedagógica do curso, à etapa e
modalidade da formação escolar o estudante e ao horário e calendário escolar;
b. Fornecer ao AGENTE DE INTEGRAÇÃO quando solicitado, relação de estudantes por curso,
informações e requisitos mínimos para a realização dos estágios;
c. Fornecer ao AGENTE DE INTEGRAÇÃO, sempre que necessário, informações referentes á
adequação das atividades descritas no Programa de Atividades de Estágio com o Projeto
Pedagógico do Curso visando a manutenção das condições e requisitos suficientes à exigência
legal para a adequação à etapa e modalidade da formação escolar dos estudantes;
d. Indicar professor orientador da área a ser desenvolvida no estágio como responsável pelo
acompanhamento e avaliação das atividades do(a) Estagiário(a);
e. Avaliar as instalações da parte concedente do estágio e sua adequação à formação cultural e
profissional do educando;
f. Atualizar o Programa de Atividades de Estágio à Proposta Pedagógica do Curso, sempre que
necessário;
g. Confirmar a situação escolar dos(as) estagiários(as) e estudantes do IFTM, quando solicitado;
h. Informar os casos de rescisões dos Termos de Compromisso de Estágio;
i. Exigir do estudante a apresentação periódica, em prazo não superior a 6 (seis) meses, de
relatório das atividades, do qual deverá constar visto do professor orientador do IFTM e do
supervisor da Unidade Concedente;
j. Divulgar junto a seus estudantes, quando for o caso, as oportunidades de estágio captadas
pela AGENTE DE INTEGRAÇÃO;
k. Comunicar ao AGENTE DE INTEGRAÇÃO, no início do período letivo, as datas de realização
de avaliações escolares ou acadêmicas, para fins de redução de carga horária de estágio no
período;

