CLÁUSULA DÉCIMA SEGUNDA – PUBLICAÇÃO
O extrato do presente Acordo de mútua cooperação será levado à publicação, pelo IFTM, no Diário
Oficial da União, até o quinto dia útil do mês subsequente ao da sua assinatura, para ser publicado no
prazo de 20 (vinte) dias daquela data, sendo a sua publicação, condição indispensável à sua eficácia.
